INSERT INTO public.form_patterns (id, title, code, form_status_group_id, default_form_status_id, description, personal_data_agreement_id, with_personal_data_agreement) VALUES ('5d77e0ca-1e75-40c7-ba9f-48f979611c41', 'Заявление в ординатуру для новопоступивших 2023', '', '5a0224d6-b7f7-414b-9ab3-d2638681b4cf', '03977c2f-31a9-4160-b194-5e595d89e434', '<p><strong>Требования к прикрепляемым документам:</strong></p><p>Чёткие цветные копии или фотографии документов в цвете, формат <strong>PDF</strong> или <strong>JPG </strong>(не четкие копии или фотографии не принимаются, как и черно-белые копии!)</p><p>Каждый файл должен быть назван как и загружаемый документ + Фамилия И.О.</p><p>(<strong>например</strong> «Приложение к диплому. Иванов А.А.)</p><p></p><p><strong>ВНИМАНИЕ!</strong> На каждую выбранную специальность, подаются разные заявления! Ординатор</p><p>имеет право подать на ДВЕ специальности одновременно. В заявлении ставится галочка основное</p><p>или дополнительное заявление.</p><p></p><p><strong>ФОТО 4 штуки 3х4</strong> -предоставляются 1 сентября 2023 года на организационном собрании</p><p><strong>ОРИГИНАЛЫ ДИПЛОМА И ПРИЛОЖЕНИЯ</strong> - предоставляются 1 сентября 2023 года на</p><p>организационном собрании</p>', '88f7848b-9b11-4d19-a307-3b596bfec9cd', false);
insert into public.fields (id, name, required, field_order, form_id, form_pattern_id, value_type_id, form_value_id, file_id, comment, code, required_for_cancel, mask)
values
        ('fb8bddfa-9862-474c-af50-ef9872d815bd', 'Договор с Департаментом здравоохранения города Москвы', false, 0, null, '5d77e0ca-1e75-40c7-ba9f-48f979611c41', '9fa59e5f-b5f4-4dd0-821f-b9aa6eb25a10', null, '1fbf3919-b631-482f-ae67-8ee8b0ac694a', 'Только для заключивших договор с Департаментом здравоохранения города Москвы', 'ContractDzm', false, ''),
        ('36ee773e-d834-47b9-8561-172075c649ed', 'Документ, удостоверяющий личность, гражданство', true, 0, null, '5d77e0ca-1e75-40c7-ba9f-48f979611c41', '9fa59e5f-b5f4-4dd0-821f-b9aa6eb25a10', null, '99eef918-7914-4887-8776-8d49ddaa9f9f', 'Со страницей регистрации', '', false, ''),
        ('58dfa01c-0812-44ab-a442-7be1a69c7c49', 'Заявление в ординатуру', true, 0, null, '5d77e0ca-1e75-40c7-ba9f-48f979611c41', '9fa59e5f-b5f4-4dd0-821f-b9aa6eb25a10', null, '7500c585-fd7d-4318-8edf-5e319f9becd7', 'Заполняется от руки четким подчерком синими чернилами или заполняется машинописным шрифтом, подписи в заявлении ставятся СИНЕЙ ручкой', '', false, ''),
        ('d243d413-fa74-40f3-a333-0b347f8261fc', 'Заявление на вступительное испытание', false, 0, null, '5d77e0ca-1e75-40c7-ba9f-48f979611c41', '9fa59e5f-b5f4-4dd0-821f-b9aa6eb25a10', null, '9039d8d5-d775-435b-bb3d-606bb829af5d', 'Заявление подается поступающим планирующим проходить вступительное испытание в другом ВУЗе или в ГБУЗ «Морозовская ДГКБ ДЗМ». На момент подачи заявления нет баллов вступительного испытания', '', false, ''),
        ('954467e8-9478-415c-af0b-a9f3779174d9', 'Заявление на изменения места проведения вступительного испытания', false, 0, null, '5d77e0ca-1e75-40c7-ba9f-48f979611c41', '9fa59e5f-b5f4-4dd0-821f-b9aa6eb25a10', null, 'b937d05c-5a94-496b-aa4d-fb11fa657fe7', 'Подается, если поступающий изменил место проведения вступительного испытания. ВНИМАНИЕ! Внесение изменений в базу данных Минздрава (приемная кампания в ординатуру) о месте вступительного испытания без данного заявления не проводится!', '', false, ''),
        ('3025c248-ea83-4895-b30e-2cf0ff1c2387', 'Заявление об отзыве документов', false, 0, null, '5d77e0ca-1e75-40c7-ba9f-48f979611c41', '9fa59e5f-b5f4-4dd0-821f-b9aa6eb25a10', null, '43129809-5424-421d-b4c5-726eb6c9d5d8', 'Если вы передумали к нам поступать и хотите, чтобы Вас сняли с конкурса, или Вы хотите отозвать заявление и подать на другую специальность', '', true, ''),
        ('64542508-631b-46ed-8075-141d7c671439', 'Заявление об учете баллов первого этапа аккредитации', false, 0, null, '5d77e0ca-1e75-40c7-ba9f-48f979611c41', '9fa59e5f-b5f4-4dd0-821f-b9aa6eb25a10', null, '844fc83c-c1b8-4828-b9bb-ae1966c58fdf', 'Заявление подается поступающим имеющим подтвержденную Первичную аккредитацию 2021 или 2022 года. Заявление дает право приемной комиссии засчитать результаты первичной аккредитации в качестве результата вступительного испытания', '', false, ''),
        ('94e8fe16-ad23-4a6f-bcea-65b747541ab2', 'Заявление об учете баллов пройденного вступительного испытания', false, 0, null, '5d77e0ca-1e75-40c7-ba9f-48f979611c41', '9fa59e5f-b5f4-4dd0-821f-b9aa6eb25a10', null, 'af55bdca-fae4-41c6-8f80-071e058ae89a', 'Заявление подается поступающим прошедшим вступительные испытания в другом ВУЗе в 2021 или 2022 году', '', false, ''),
        ('8c2d0b2b-4330-43cb-82d5-c00f561bcead', 'Заявление о согласии на зачисление', false, 0, null, '5d77e0ca-1e75-40c7-ba9f-48f979611c41', '9fa59e5f-b5f4-4dd0-821f-b9aa6eb25a10', null, '884046b1-d295-4ccd-97d9-8874eb9421b8', 'Станет доступным после проведения конкурса', '', false, ''),
        ('556e53f8-d6ff-402f-90ee-392628df7edf', 'ИНН', true, 0, null, '5d77e0ca-1e75-40c7-ba9f-48f979611c41', '9fa59e5f-b5f4-4dd0-821f-b9aa6eb25a10', null, 'e25e69a6-1655-4b38-acf8-3983a0d5770c', '', '', false, ''),
        ('131a1ddd-3f62-4c37-8050-dcbbac861bdf', 'СНИЛС', true, 0, null, '5d77e0ca-1e75-40c7-ba9f-48f979611c41', '9fa59e5f-b5f4-4dd0-821f-b9aa6eb25a10', null, '0c265dd5-5487-4c0e-a877-79c42655dc95', '', '', false, '');
